<p class="c7 c30"><span class="c26">MANDAT DE PRELEVEMENT SEPA </span></p>
<p class="c30 c7"><span class="c26">interentreprises</span></p>
<p class="c7 c149"><span class="c56">Référence unique du mandat : 1711003REU</span></p>
<p class="c7 c69"><span class="c86">En signant ce formulaire de mandat, vous autorisez le Créancier à envoyer des instructions à votre banque pour débiter votre compte, et votre banque à débiter votre compte conformément aux instructions du Créancier. Ce mandat est dédié aux prélèvements SEPA interentreprises.</span>
</p>
<p class="c69 c7"><span class="c86">Vous n’êtes pas en droit de demander à votre banque le remboursement d’un prélèvement SEPA interentreprises une fois que le montant est débité de votre compte. Vous pouvez cependant demander à votre banque de ne pas débiter votre compte jusqu’au jour de l’échéance.</span>
</p>
