<p class="c3"><span class="c49"></span></p>
<p class="c3"><span class="c49"></span></p>
<p class="c41 c23"><span class="c21">Dans les cas où la TVA sur loyer est encaissée par la banque ou payée par chèques et sous réserve de l'encaissement effectif, INVESTIS DOM SAS ne prélèvera pas les sommes dues à ce titre.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">Si la Cotisation Foncière des Entreprises et taxes annexes sont payées par chèque, sous réserve du paiement effectif du chèque, INVESTIS DOM SAS ne prélèvera pas les sommes dues à ce titre.</span>
</p>
<p class="c41 c36"><span class="c21"></span></p>
<p class="c23 c41"><span class="c21">Tous frais, taxes, impôts de toute nature, présents ou à venir, notamment la Cotisation Foncière des Entreprises et Taxes Annexes (ex Taxe Professionnelle) dont le LOUEUR serait redevable, seront à la charge exclusive du LOCATAIRE.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">En cas de retard dans le paiement de toute somme due par le LOCATAIRE, le LOUEUR se réserve la faculté d'exiger le versement d'une indemnité de retard égale à 1,5% des sommes dues par mois de retard qui s'ajoutent aux intérêts de retard prévus à l'article 8 du contrat de location. Une somme forfaitaire de 100 € HT sera facturée par loyer impayé, en sus des autres frais et intérêts de retard mentionnés précédemment. Tout mois commencé est dû intégralement.</span>
</p>
<p class="c41 c7 c36"><span class="c21"></span></p>
<p class="c41 c23"><span class="c21">Les informations contenues dans le présent mandat, qui doit être complété, sont destinées à n’être utilisées par le créancier que pour la gestion de sa relation avec son client. Elles pourront donner lieu à l’exercice, par ce dernier, de ses droits d’oppositions, d’accès et de rectification tels que prévus aux articles 38 et suivants de la loi n°78-17 du 6 janvier 1978 relative à l’informatique, aux fichiers et aux libertés.</span><a
        id="id.1fob9te"></a></p>
